import React from 'react';
import { Grid, CircularProgress } from '@material-ui/core';
import { useSelector } from 'react-redux';

import useStyles from './styles';

const Sensors = ({ setCurrentId }) => {
  const sensors = useSelector((state) => state.sensors);
  const classes = useStyles();

  return (
<Card className={classes.card}>
<div className={classes.overlay}>
  <Typography variant="h6">{sensor.channel}</Typography>
  <Typography variant="h6">{sensor.feeds}</Typography>
  
</div>


<CardContent>
  <Typography variant="body2" color="textSecondary" component="p">{sensor.channel}}</Typography>
  <Typography variant="body2">{sensor.feeds}</Typography>
</CardContent>

</Card>
    
  );
};

export default Sensors;
